import React, { useEffect, useState } from 'react';
import API from '../utils/api';

function Colleges() {
    const [colleges, setColleges] = useState([]);
    const [page, setPage] = useState(1);
    const [totalPages, setTotalPages] = useState(1);
    const [search, setSearch] = useState('');
    const [sort, setSort] = useState('ranking');
    const [order, setOrder] = useState('asc');
    const [minRanking, setMinRanking] = useState('');

    useEffect(() => {
        fetchColleges();
    }, [page, sort, order, minRanking]); // Search is triggered manually or by debounce (manual for now)

    const fetchColleges = () => {
        let query = `/colleges?page=${page}&limit=10&sort=${sort}&order=${order}`;
        if (search) query += `&search=${search}`;
        if (minRanking) query += `&minRanking=${minRanking}`;

        API.get(query)
            .then(res => {
                setColleges(res.data.data);
                setTotalPages(res.data.totalPages);
            })
            .catch(err => console.error(err));
    };

    const handleSearch = (e) => {
        e.preventDefault();
        setPage(1);
        fetchColleges();
    };

    return (
        <div className="section">
            <h2 className="text-center mb-2">Top Colleges</h2>

            <div className="card mb-2" style={{ padding: '1rem' }}>
                <form onSubmit={handleSearch} style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap', alignItems: 'center' }}>
                    <input
                        type="text"
                        placeholder="Search by name or location..."
                        value={search}
                        onChange={(e) => setSearch(e.target.value)}
                        style={{ padding: '0.5rem', flex: 1 }}
                    />
                    <select value={sort} onChange={(e) => setSort(e.target.value)} style={{ padding: '0.5rem' }}>
                        <option value="ranking">Sort by Ranking</option>
                        <option value="name">Sort by Name</option>
                        <option value="location">Sort by Location</option>
                    </select>
                    <select value={order} onChange={(e) => setOrder(e.target.value)} style={{ padding: '0.5rem' }}>
                        <option value="asc">Ascending</option>
                        <option value="desc">Descending</option>
                    </select>
                    <input
                        type="number"
                        placeholder="Max Ranking"
                        value={minRanking}
                        onChange={(e) => setMinRanking(e.target.value)}
                        style={{ padding: '0.5rem', width: '100px' }}
                    />
                    <button type="submit" className="btn">Search</button>
                </form>
            </div>

            <div className="grid">
                {colleges.map((college) => (
                    <div key={college._id} className="card">
                        <h3>{college.name}</h3>
                        <p><strong>Location:</strong> {college.location}</p>
                        <p><strong>Ranking:</strong> #{college.ranking}</p>
                        <p><strong>Courses:</strong> {college.courses.join(', ')}</p>
                    </div>
                ))}
            </div>

            {colleges.length === 0 && <p className="text-center">No colleges found.</p>}

            {totalPages > 1 && (
                <div className="text-center mt-2">
                    <button
                        className="btn"
                        disabled={page === 1}
                        onClick={() => setPage(page - 1)}
                        style={{ marginRight: '10px' }}
                    >
                        Prev
                    </button>
                    <span>Page {page} of {totalPages}</span>
                    <button
                        className="btn"
                        disabled={page === totalPages}
                        onClick={() => setPage(page + 1)}
                        style={{ marginLeft: '10px' }}
                    >
                        Next
                    </button>
                </div>
            )}
        </div>
    );
}

export default Colleges;
